import Expense from "./Expense";

function App(){
    const items = [
        {
            date : new Date(2003 , 6 , 10),
            title : "life insurance" ,
            amount : 234.89
        } , 
        {
            date: new Date(2003 , 1 , 5 ) , // year month date
            title : "Car Insurance" , 
            amount : 456.90
        } ,
        {
            date: new Date(2004 , 3 , 6) , 
            title : "Scooty Insurance" , 
            amount : 353.77
        },
        {
            date : new Date(2006 , 11 , 21) , 
            title : "Car Insurance" , 
            amount : 1000
        }
    ]

    return (
        <div>
            <Expense a = {items}></Expense>
            {/* <p> hello </p> */}
        </div>
    );
}

export default App;
